package com.min.word.core;

import java.awt.image.BufferedImage;
import java.io.ByteArrayInputStream;
import java.io.File;
import java.io.FileWriter;

import javax.imageio.ImageIO;

import org.apache.xmlbeans.impl.util.Base64;

public class Base64ToImage {
	
	static String imgChars = "data:image/png;base64,";
	
	public static void main(String[] args) throws Exception{
		BufferedImage image = null;
		imgChars = imgChars.replace("data:image/png;base64,", "");
		imgChars = imgChars.replace(" ", "+");
		byte [] b = Base64.decode(imgChars.getBytes());
		ByteArrayInputStream bis = new ByteArrayInputStream(b);
		image = ImageIO.read(bis);
		bis.close();
		ImageIO.write(image, "png", new File("img.png"));
	}
}
